import React from 'react';

const Table = () => {
    return (
        <div>
            <table>
                <thead>
                    <th>
                        <td>Item description</td>
                    
                        <td>Quantity</td>
                    </th>
                    <th>
                        <td>Price</td>
                    </th>
                    <th>
                        <td>Amount</td>
                    </th>
                </thead>
            </table>
        </div>
    );
};

export default Table;
